kulgram mingguan:
**Property vs Field
**Pada bahasa pemrograman lain, sebuah class minimal punya method (merepresentasikan action) & field (merepresentasikan data). Namun pada kenyataannya, untuk mengakses sebuah field, harus dibungkus dengan method mengakses atau memberi nilai. Contoh:
```class Pegawai
{
  private int umur;
  public int GetUmur() 
  {
    return this.umur;
  }
  public void SetUmur(int umur)
  {
    this.umur = umur;
  }
}
```Hal ini wajar, mengingat best practice untuk sebuah data memang selayaknya dibungkus sebagai layer abstraksi. Sehingga jika terjadi perubahan lojik atau butuh refactoring, akan lebih mudah. 
Nah untuk C#, hal ini bisa dilakukan dengan property sbb:
```class Pegawai
{
  private int umur;
  public int Umur 
  {
    get { return this.umur; }
    set { this.umur = value; }
  }
}
```Private field diatas biasa disebut __backing field__. Untuk .NET framework yg baru, jika backing field hanya untuk menyimpan data tanpa ada tambahan lojik, backing field tidak perlu dituliskan, sehingga bisa disingkat: `public int Umur { get; set; }`
Lalu kenapa kita tidak menggunakan field/method saja. Jawabannya adalah property pada dasarnya adalah abstraksi sebuah field (ada hidden getter & setter method). Namun property diberlakukan layaknya field.

@fakhrulhilal kadang saya ketemu yang bikin field nya kyk begini:

public int foo { get; private set; }

ini artinya apa ya kalo ditambahin private?

**Contoh property
**__DON'T
__```class Pegawai
{
  private IDbConnection _db;
  public int Id { set; set; }
  public int Umur 
  {
    get 
    {
      var umur = _db.Query<int>("SELECT umur FROM Pegawai WHERE ID = @Id", new { Id }).FirstOrDefault();
      return umur ?? default;
    }
    set
    {
      _db.Execute("UPDATE Pegawai SET umur = @umur WHERE ID = @Id", new { Id, umur = value });
    }
  }
}
```__DO
__```class Pegawai
{
  private IDbConnection _db;
  public int Id { get; set; }
  public int Umur { get; set; }
  public void Initialize()
  {
    var umur = _db.Query<int>("SELECT umur FROM Pegawai WHERE ID = @Id", new { Id }).FirstOrDefault();
    Umur = umur ?? default;
  }
  public void Save()
  {
    _db.Execute("UPDATE Pegawai SET umur = @Umur WHERE ID = @Id", new { Id, Umur });
  }
}
```Penjelasan:
Property sebaiknya tidak langsung mengakses resource eksternal (dalam hal ini database connection). Karena bisa saja terjadi hal-hal yang diluar dugaan (__side effect__). Bisa jadi sewaktu query ke database terjadi exception sehingga rule 2 terjadi. Maka sebaiknya direfactor ke method terpisah.

